import React, {useState, useEffect} from "react";
import {Link, useNavigate} from "react-router-dom";
import axios from "axios";

const Registration = () => {
    let[username, setUserName] = useState("");
    let[password, setPassword] = useState("");
    let navigate = useNavigate();

    const registerSubmit= ()=>{
        var obj = {username: username, password: password};
    }
    return(
        <div className ="formContent">
            <form>
                <label className="label">Registration</label><br></br>
                <input className="input" type="text" value={username} onChange={(e)=>setUserName(e.target.value)}></input><br></br>
                <input className="input" type="password" value={password} onChange={(e)=>setPassword(e.target.value)}></input>
            </form>
                <button className= "button" onClick={registerSubmit}>Register</button>
                <p>Already have an account?</p>
                <u><Link to="/login"> Login</Link></u>
        </div>
    )
}

export default Registration;
